INSERT INTO `taches_admin` (`id_tache_admin`, `lib_tache_admin`, `description`, `url_action`, `date_creation`, `date_execution`) VALUES
(30, 'Renseignements sur l''entreprise', 'Veuillez définir la date de debut d''activité de votre entreprise.', 'configuration_activite.php', '2011-05-01 13:57:37', '0000-00-00 00:00:00'),
(31, 'Configuration du catalogue', 'Etape importante et délicate, vous permet de définir les règles de gestion de votre catalogue d''article.', 'configuration_catalogue.php', '2011-05-01 13:57:37', '0000-00-00 00:00:00'),
(32, 'Gérer les lieux de stockage', 'Si vous possédez plusieurs lieux de stockage et désirez gérer le stock pour chacun d''entre eux.<br />Par exemple : Magasin, Entrepôt ', 'catalogue_stockage.php', '2011-05-01 13:57:37', '0000-00-00 00:00:00'),
(33, 'Configuration les paramètres tarifaires', 'Permet de définir les données par défaut pour la gestion des Prix ausi que les grilles de tarifs', 'configuration_tarifs.php', '2011-05-01 13:57:37', '0000-00-00 00:00:00'),
(34, 'Gérer les points de vente', 'Si vous possédez plusieurs points de vente. (Un magasin de e-commerce est considéré comme un point de vente à part entière)<br />Par exemple : Magasin Le Vigan, Magasin Montpellier, monsite.fr', 'catalogue_magasins.php', '2011-05-01 13:57:37', '0000-00-00 00:00:00'),
(35, 'Gérer les catégories de clients', 'Par exemple : Particulier, Revendeur<br />\r\n(Vous pourrez paramétrer par la même occasion l''application automatique d''une grille tarifaire aux différentes catégories de clients.) <br />Permet également d''avoir des statistiques détaillées sur vos ventes.', 'annuaire_gestion_categories_client.php', '2011-05-01 13:57:37', '0000-00-00 00:00:00'),
(36, 'Gérer les catégories de fournisseurs', 'Par exemple : Prestataires de services, Grossistes.<br />Permet également d''avoir des statistiques détaillées sur vos achats.', 'annuaire_gestion_categories_fournisseur.php', '2011-05-01 13:57:37', '0000-00-00 00:00:00'),
(37, 'Gestion des exercices comptables', 'Veuillez définir la date de fin de votre premier exercice comptable.', 'compta_exercices.php', '2011-05-01 13:57:37', '0000-00-00 00:00:00'),
(38, 'Gestion des catégories d''article du catalogue général', 'Vous permet de définir les catégories et sous catégories d''articles. Ainsi, vous pouvez définir les différents taux de marge pour chacune d''elles.<br />Permet également d''obtenir des statistiques détaillées sur vos ventes.', 'catalogue_categorie.php', '2011-05-01 13:57:37', '0000-00-00 00:00:00'),
(39, 'Gestion des comptes bancaires', 'Permet de suivre vos comptes bancaires et d''automatiser certaines taches de comptabilité avec SoothERP.', 'compta_compte_bancaire.php', '2011-05-01 13:57:37', '0000-00-00 00:00:00'),
(40, 'Gestion des TPE', 'Si vous utiliser un Terminal de Paiement Electronique.<br />Permet de gérer les encaissements par Carte Bancaire.', 'compta_compte_tpes.php', '2011-05-01 13:57:37', '0000-00-00 00:00:00'),
(41, 'Gestion des caisses', 'Si vous utilisez plusieurs caisses (réparties sur 1 ou plusieurs points de vente).<br />Permet de gérer les encaissements par chèque et espèces.', 'compta_compte_caisse.php', '2011-05-01 13:57:37', '0000-00-00 00:00:00'),
(42, 'Gestion des cartes bancaires', 'Si vous possédez une carte bancaire.<br />\r\nPermet de gérer les règlements par Carte Bancaire (décaissement).', 'compta_compte_cbs.php', '2011-05-01 13:57:37', '0000-00-00 00:00:00'),
(43, 'Configuration PDF', 'Permet de personnalisés les documents imprimés (Devis, Factures.)', 'configuration_pdf.php', '2011-05-01 13:57:37', '0000-00-00 00:00:00');
